app.factory("descargaJson", function()
{ 
  var jsonDescarga={"returnCode":0,"array":[]};
  
  return{
    getTotal:function(){
      return jsonDescarga.array.length;
    },
    getAll:function(){
      return jsonDescarga.array;
    },
    addone:function(){
      jsonDescarga.array.push({
                                "name": "name"
                             });
    },
    reset:function(){
      jsonDescarga.array.length = 0;
    },

  };

});

